import React from "react";

export default function CardMovieModel({ movie }) {
  return (
    <div
      style={{
        width: 250,
        height: 400,
      }}
      className="border rounded-2 p-2 col-4"
    >
      <img src={movie?.hinhAnh} height={300} className="w-100" alt="" />
      <p>{movie?.tenPhim}</p>
      <button className="btn btn-success">Click</button>
    </div>
  );
}
